import React from 'react';

function ContactSlip() {
// 151C29,647692,4199E0,4CB1F3

    const contactSlipCont = {
        background: '#4199E0',
        color: '#eee',
        display: 'flex',
        justifyContent: 'space-around',


        padding: '30px',
    }

    const leftBlock = {
        backgroundColor: 'red',
    }

    const rightBlock = {
        backgroundColor: 'green',
    }

  return (
    <div className="contactSlip" style={ contactSlipCont }>
      <div style={ leftBlock }>Contact Us Today!</div>
      <div style={ rightBlock }>Hello</div>
    </div>
  );
}

export default ContactSlip;
